на первом фото: школа в Харькове, в которую ходили некоторые из наших Кидсеров. эта школа уничтожена армией РФ;

на втором фото: дети из детского дома, которые вынуждены жить в бомбоубежище с ограниченными ресурсами (еда, вода, тепло), потому что они спасаются от армии РФ;

на третьем фото: наш родной город Киев вчера. погибло 5 мирных людей, которые просто шли мимо;

на четвертом фото: Харьков сегодня. Там искали приемных родителей для двойняшек, которые родились вчера, а их родители погибли;

на пятом фото: так люди живут в метро уже 7й день. Беременные женщины, дети, старики, животные;

на шестом фото: маленький город Бородянка, который полностью разрушен армией РФ и люди остались без дома;

на седьмом фото: митинги, которые проходят по всему миру, в каждой стране поддерживают Украину и осуждают агрессию РФ;

на восьмом фото: те, кого Путин отправляет воевать в Украину. почти наши ровесники, дети, которые могут умереть и умирают, потому что наша армия защищает нас и нашу землю;

на девятом фото: наш Президент и Министр Обороны. Мы любим их, мы верим в них и знаем, что они рядом и делают все, чтобы защитить нас

Мы дети! И мы не должны это видеть! Но сейчас все так: в Украине война, Путин отправил в нашу страну армию под лживым предлогом «спасти народ». Но нас не нужно было спасать! Мы жили счастливо и свободно до 24 февраля. Сейчас мы живем в страхе и не знаем, выживем ли…

Мы верим в нашу армию, мы верим в наше правительство и мы хотим донести ПРАВДУ! Россия напала на Украину! Умирают мирные жители (среди них дети)! Бомбят жилые дома!

Матери РФ и РБ, не отпускайте своих детей к нам воевать, это верная смерть для них!

Наши друзья и РФ и РБ, НЕ МОЛЧИТЕ! Вы знаете правду, не бойтесь её говорить! Поверьте, нам сейчас страшнее.

Дети РФ и РБ, не смотрите телевизор, умоляем вас! Там пропаганда и ложь!

